// SPDX-License-Identifier: MIT
pragma solidity ^0.8.7;


contract Company {

    // Company contract.
    // owners of the contract are the share holders of the company.

    mapping(address => bool) isOwner;
    mapping(address => uint256) share;
    address public master;
    address[] public owners;

    // Events
    event MasterSetup(address indexed master);

    event OwnerAddition(address indexed owner);

    event ShareGivien(address indexed receiver);

    event Transfer(address indexed receiver, uint256 amount);

    event OwnerRemoval(address indexed owner);

    modifier onlyMaster() {
        require(msg.sender == address(master));
        _;
    }

    modifier onlyOwners() {
        require(isOwner[msg.sender], "Only owner can be added");
        _;
    }

    modifier onlyAdmins() {
        require(isOwner[msg.sender] || msg.sender == address(master), "Only master or owners");
        _;
    }

    // designates the President -> constructor(address master)
    constructor(address _master) {
        master = _master;
        share[master] = 10000000;
        emit MasterSetup(master);
    }


    // designates the owner of the company -> setupOwners()
    function addOwners(address owner) 
        onlyMaster 
        public
    {
        isOwner[owner] = true;
        owners.push(owner);
        share[owner] = 5000000;

        emit OwnerAddition(owner);
    }

    // gets the addresses of the company -> getOwners()
    function getOwners()
        public
        view
        returns (address[] memory)
    {
        return owners;
    }

    // check if the given address is one of the owners -> isOwner()
    function checkIfOwner(address owner)
        public
        view
        returns (bool)
    {
        return isOwner[owner];
    }

    // can give share to anyone they want -> giveShare()
    function giveShare(address receiver, uint256 stake)
        public
        onlyAdmins
    {
        require(share[msg.sender] >= stake, "Stake exceeds the sender allowance");
        share[msg.sender] = share[msg.sender] - stake;
        share[receiver] += stake;

        emit Transfer(receiver, stake);
    }

    // can give share only to one of the owners -> addShare()
    function addShare(address receiver, uint256 stake)
        public
        onlyAdmins
    {
        require(share[msg.sender] >= stake, "Stake exceeds the sender allowance");
        require(isOwner[receiver], "The receipient should only be one of the owners");
        share[msg.sender] = share[msg.sender] - stake;
        share[receiver] += stake;

        emit Transfer(receiver, stake);
    }

    // remove the owner from the owners list(only master can do it) -> removeOwner()
    function removeOwner(address owner)
        public
        onlyMaster
    {
        require(isOwner[owner], "Only owners can be removed from owner list");
        isOwner[owner] = false;
        for (uint i = 0; i < owners.length - 1; i++)
            if (owners[i] == owner) {
                owners[i] = owners[owners.length - 1];
                break;
            }
        owners.pop();

        emit OwnerRemoval(owner);
    }
}
